(1, '2022-01-09', 'P.101010101000/2T', 1, 1, 1, 1, 1, 1, 'BANGUNAN LUAR BAWAH GARIS AIR', 'Pemeriksaan, pembersihan dan pengecatan bottom dan bottop', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Laksanakan pembersihan pada bottom dan bottop dengan air bertekanan tinggi</li><li>Laksanakan pembersihan bagian yang rusak dan korosi  pada bottom dan bottop dengan cara diblasting SA 2.5</li><li>Cat lapisan dasar bottom dan bottop </li><li>Cat lapisan kedua bottom dan bottop </li><li>Cat lapisan kedua bottom dan bottop </li><li>Cat dengan anti fouling bagian bottom </li><li>Cat tanda sarat kapal  </li></ol>', 'Kompressor udara untuk pengecatan, Kunci-kunci, Lap kering, Kuas', '0', '2022-09-01 08:00:00', '2022-06-29 16:12:24', 0, 9, '2022-09-01', 1),
(2, '2022-01-09', 'P.101010101000/6T', 1, 1, 1, 1, 1, 1, 'BANGUNAN LUAR BAWAH GARIS AIR', 'Pemeriksaan badan kapal dan pengecatan nomer lambung kapal', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cat nomer lambung kapal </li><li>Periksa badan kapal bawah garis air: Pemeriksaan dari kondisi asli sistem pengecatan </li></ol>', 'Kompressor udara untuk pengecatan, Kunci-kunci, Lap kering, Kuas', '0', '2022-09-01 08:00:00', '2022-06-29 16:24:55', 0, 13, '2022-09-01', 1),
(4, '2022-01-09', 'P.101020101000/M', 1, 1, 2, 2, 1, 2, 'SARANGAN SEA CHEST DG', 'Pengecekan penggunaan umum katup', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Buka dan tutup katup yakinkan bisa terbuka dan tertutup dengan mudah </li><li>Jika Membuka dan menutup terasa berat, lumasi dengan Grease </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:09:31', 0, 2, '2022-09-01', 1),
(5, '2022-01-09', 'P.101020102000/M', 1, 1, 2, 2, 1, 3, 'SARANGAN SEA CHEST PEMADAM', 'Cek penggunaan umum katup', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Buka dan tutup katup yakinkan bisa terbuka dan tertutup dengan mudah</li><li>Jika Membuka dan menutup terasa berat, lumasi dengan Grease</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:10:26', 0, 2, '2022-09-01', 1),
(6, '2022-01-09', 'P.101020103000/M', 1, 1, 2, 2, 1, 3, 'SARANGAN SEA CHEST PENDINGIN AC', 'Cek penggunaan umum katup', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Buka dan tutup katup yakinkan bisa terbuka dan tertutup dengan mudah</li><li>Jika Membuka dan menutup terasa berat, lumasi dengan Grease</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:10:36', 0, 2, '2022-09-01', 1),
(7, '2022-01-09', 'P.101020104000/M', 1, 1, 2, 2, 1, 3, 'SARANGAN SEA CHEST MPK', 'Cek penggunaan umum katup', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Buka dan tutup katup yakinkan bisa terbuka dan tertutup dengan mudah</li><li>Jika Membuka dan menutup terasa berat, lumasi dengan Grease</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:11:11', 0, 2, '2022-09-01', 1),
(8, '2022-01-09', 'P.101020105000/M', 1, 1, 2, 2, 1, 4, 'SARANGAN SEA CHEST PEMADAM DARURAT', 'Cek penggunaan umum katup', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Buka dan tutup katup yakinkan bisa terbuka dan tertutup dengan mudah</li><li>Jika Membuka dan menutup terasa berat, lumasi dengan Grease</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:11:39', 0, 2, '2022-09-01', 1),
(9, '2022-01-09', 'P.101020106000/M', 1, 1, 2, 2, 1, 5, 'SARANGAN SEA CHEST BILGE / BALLAST', 'Cek penggunaan umum katup', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Buka dan tutup katup yakinkan bisa terbuka dan tertutup dengan mudah</li><li>Jika Membuka dan menutup terasa berat, lumasi dengan Grease</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:11:48', 0, 2, '2022-09-01', 1),
(10, '2022-01-09', 'P.102010101000/4T', 1, 2, 3, 3, 1, 6, 'BANGUNAN LUAR ATAS GARIS AIR', 'Periksa cat bagian luar seluruhnya', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ul><li>Periksa cat bagian luar seluruhnya, Uji lapisan cat dan rawat bagian-bagian yang diperlukan </li></ul>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:18:09', 0, 11, '2022-09-01', 1),
(11, '2022-01-09', 'P.102020101000/B', 1, 2, 4, 4, 1, 7, 'PINTU KEDAP', 'Lakukan perawatan sesuai prosedure pada pintu kedap', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<ol><li>Periksa lubang dari masuknya kotoran, debu dan pecahan lagam yang dapat menyumbat lubang tersebut </li><li>Periksa lubang dari karat karena air yang selalu melewati </li><li>Salurkan air, untuk memeriksa lancarnya aliran saluran pembuangan pada pintu</li><li>Periksa struktur penjepit (Cleats) dari keausan paking-pakingnya. ganti jika paking aus/rusak </li><li>Periksa hubungan antara corner piece dengan tangkai penghubung dari lengket karena kotor atau karat, bersihkan dan lumasi bila perlu</li><li>Periksa sistem penguncian dari pintu melalui handlenya. apakah sistem penguncian tepat dan pas </li><li>Periksa sistem pergerakan buka/tutup. Pintu tingkap harus smooth saat buka/tutup, jika pergerakan tidak smooth, amati dan cari penyebabnya </li><li>Periksa pin-pin pada engsel-engselnya dari keausan, lengket karena korosi dan ketidaklurusan </li><li>Periksa permukaan dan frame pintu dari korosi, deformasi, retak dan pengelupasan catnya. Jika terjadi korosi secepatnya dibersihkan, jika perlu di cat ulang </li><li>Periksa elastisitas, kerusakan secara mekanik dan deformasi setempat dari seal karet </li><li>Periksa seal karet dari penuaan, jika itu terjadi secepatnya harus diganti </li><li>Bersihkan permukaan seal karet dari kotoran-kotoran yang melekat dengan spatula kayu dan kain lap </li><li>Lumasi baut-baut Penghubung, Handle, seal karet dengan MOBIL GREASE </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:20:56', 0, 3, '2022-09-01', 1),
(12, '2022-01-09', 'P.102020201000/3B', 1, 2, 4, 5, 1, 8, 'JENDELA ANJUNGAN', 'Cek mekanik wiper', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek secara visual kondisi teknis mekanik wiper dari kemungkinan aus atau rusak akibat pemakaian </li><li>Cek kondisi teknis secara visual penyemprot air dari kemungkinan buntu </li><li>Cek sambungan-sambungan penyemprot air dari kemungkinan kebocoran, coba kencangkan nipel jika ada kebocoran </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:08:18', 0, 5, '2022-09-01', 1),
(13, '2022-01-09', 'P.201010101000/H', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Pemeriksaan kompoen dan indikator', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa level oli mesin</li><li>Periksa secara visual kebocoran dan kondisi umum mesin</li><li>Periksa indikator perawatan filter udara </li><li>Periksa lubang bantuan pompa pendingin </li><li>Saat mesin hidup, periksa apakah ada suara bising yang tidak normal, warna gas buang, dan getaran </li><li>Kuras air dan kontaminan dari prefilter bahan bakar </li><li>Periksa penunjuk pengukur vakum dari prefilter bahan bakar </li><li>Periksa katup pembuangan cairan pendingin FUEL TREATMENT PLANT </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 09:56:17', 0, 1, '2022-09-01', 1),
(14, '2022-01-09', 'P.201010101000/500JAM', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Periksa dan bersihkan filter oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa Filter oli sentrifugal otomatis, periksa ketebalan lapisan residu oli </li><li>Membersihkan dan mengganti elemen kertas pada setiap penggantian oli mesin </li><li>Periksa dan bersihkan layar penyaringan Filter oli otomatis </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:34:22', 0, 18, '2022-09-01', 2),
(15, '2022-01-09', 'P.201010101000/1000JAM', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Pemeriksaan  secara visual PRELUBRIKASI pompa', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa secara visual PRELUBRIKASI pompa </li><li>Penggantian filter prefilter bahan bakar </li><li>Ganti filter bahan bakar yang mudah diganti pada sistem bahan bakar </li><li>Periksa batang artikulasi dari keausan pasokan udara ke silinder </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:34:51', 0, 19, '2022-09-01', 2),
(16, '2022-01-09', 'P.201010101000/3000JAM', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Pemeriksaan dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa kondisi umum dudukan karet (pemeriksaan visual ENGINE MOUNTING) </li><li>Periksa sekrup pengaman untuk tempat duduk yang aman PEMASANGAN MESIN </li><li>Ganti filter udara AIR SUPPLY SISTEM </li><li>Ganti penutup katup SISTEM PENDINGIN </li><li>Periksa kondisi kopling GENERATOR PENGISIAN BATERAI </li><li>Periksa celah katup, sesuaikan jika perlu pada VALVE GEAR </li><li>Ukur penonjolan katup CYLINDER HEAD </li><li>Periksa pemutaran aksial flap pembatas PASOKAN UDARA KE SILINDER </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:36:12', 0, 20, '2022-09-01', 2),
(17, '2022-01-09', 'P.201010101000/7000JAM', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Penggantian separator oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Ganti separator oli (impaktor) CRANKCASE BREATHER </li><li>Periksa liner silinder dengan endoskop RUNNING GEAR </li><li>Setel ulang parameter koreksi penyimpangan (CDC) GOVERNOR </li><li>Ganti fuel injection valve/injector  </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:38:27', 0, 22, '2022-09-01', 2),
(18, '2022-01-09', 'P.201010101000/10500JAM', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Melakukan overhaul dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Ganti pemisah oli CRANKCASE BREATHER </li><li>Ganti selongsong karet RUBBER SLEEVE&nbsp;</li><li>Periksa housing termostat HT dan ganti aktuator termal SISTEM PENDINGIN </li><li>Bersihkan SISTEM COOLANT pendingin air laut </li><li>Periksa filter oli sentrifugal dari keausan pada LUBE OIL SISTEM </li><li>Periksa fungsi katup pengalir pada DIVERTER VALVE </li><li>Ganti SISTEM BAHAN BAKAR pompa HP (TEKANAN TINGGI) </li><li>Periksa rocker arm dan valve bridge dari keausan pada VALVE GEAR </li><li>Periksa secara visual permukaan berjalan camshaft dengan endoskop melalui lubang pushrod pada VALVE GEAR </li><li>Ganti tutup pembatas SUPPLY UDARA KE SILINDER </li><li>Ganti sealing material untuk pemasangan coolant pump&nbsp;</li><li>Overhaul atau ganti knalpot turbocharger EXHAUST TURBOCHARGER </li><li>Overhaul atau ganti starter STARTING SISTEM </li><li>Overhaul atau ganti pompa pendingin di sirkuit HT COOLANT SISTEM </li><li>Perbaiki atau ganti pompa lambung kapal </li><li>Overhaul atau ganti raw water pump pada COOLANT SISTEM </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:41:50', 0, 24, '2022-09-01', 2),
(19, '2022-01-09', 'P.201010101000/21000JAM', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Melakukan overhaul dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<ol><li>Ganti bellow karet, Ganti saluran selang </li><li>Pada filter oli otomatis, lepaskan dan bersihkan rumah filter, ganti elemen filter dan bantalan </li><li>Ganti HP fuel sensor FUEL SISTEM (TEKANAN TINGGI)&nbsp; dan gear pump OIL REPLENISHING UNIT</li><li>Ganti pompa FUEL SISTEM (TEKANAN RENDAH) </li><li>Merombak atau mengganti generator pengisian baterai </li><li>Overhaul atau ganti kepala silinder </li><li>Ganti suku cadang elastomer dan segel ENGINE GENERAL&nbsp;</li><li>Periksa komponen mesin sesuai dengan petunjuk perakitan, ganti atau perbaiki seperlunya&nbsp;</li><li>Periksa kopling dan pompa lube oil SISTEM ganti jika perlu </li><li>Ganti katup pelepas tekanan dan swing follower shaft pada VALVE GEAR </li><li>Ganti flensa bantalan dorong VALVE GEAR\r\n14.Ganti bantalan conrod, ring RUNNING GEAR </li><li>Periksa sisi gigi di gear train untuk keausan (pemeriksaan visual), ganti bushing GEAR TRAIN </li><li>Ganti liner silinder RUNNING GEAR </li><li>Ganti bantalan poros bubungan </li><li>Ganti elemen karet dudukan karet pada ENGINE MOUNTING </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:46:10', 0, 27, '2022-09-01', 2),
(20, '2022-01-09', 'P.201010101000/T', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Pemeriksaan fungsi dan kebocoran', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa fungsi dan kebocoran pada Preheater </li><li>Periksa kinerja pompa bahan bakar </li><li>Lakukan penggantian elemen filter </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:55:05', 0, 8, '2022-09-01', 1),
(21, '2022-01-09', 'P.201010101000/2T', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Tes fungsi FUEL TREATMENT PLANT', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ul><li>Periksa fungsi FUEL TREATMENT PLANT elektroda batang </li></ul>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:13:12', 0, 9, '2022-09-01', 1),
(22, '2022-01-09', 'P.201010101000/3T', 2, 3, 5, 6, 1, 2, 'MAIN ENGINE MTU 20V 4000-M73', 'Penggantian termostat', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ul><li>Penggantian termostat (listrik) Preheater </li></ul>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:16:37', 0, 10, '2022-09-01', 1),
(23, '2022-01-09', 'P.201020101000/100JAM', 2, 3, 6, 7, 1, 3, 'GEAR BOX ZF 9055', 'Perawatan 100 Jam Oprasional Gearbox', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Kencangkan semua sambungan sekrup yang dapat diakses dari luar </li><li>Periksa pengaturan shift aktuasi mekanis </li><li>Lakukan penggantin oli</li><li>Mengganti kartrid filter dan membersihkan filter pengambilan daya </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:32:12', 0, 17, '2022-09-01', 2),
(24, '2022-01-09', 'P.201020101000/10000JAM', 2, 3, 6, 7, 1, 3, 'GEAR BOX ZF 9055', 'Perawatan 10.000 Jam Oprasional Gearbox', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Memeriksa level oli dan melakukan inspeksi visual </li><li>Membersihkan bagian luar transmisi </li><li>Mengencangkan kembali semua sambungan sekrup yang dapat diakses dari luar </li><li>Memeriksa pengaturan shift aktuasi mekanis </li><li>Melumasi bagian eksternal yang bergerak dari aktuasi mekanis </li><li>Mengganti oli, kartrid filter dan membersihkan filter pengambilan daya </li><li>Melakukan inspeksi visual pada kopling fleksibel torsi </li><li>Melakukan inspeksi visual pada pemasangan transmisi fleksibel dan pemasangan engine fleksibel </li><li>Melakukan inspeksi visual pada cakram kopling </li><li>Melakukan inspeksi visual saat menjalankan gearing </li><li>Memeriksa pompa minyak, unit kontrol dan blok katup dari pengambilan daya dan rem poros </li><li>Memeriksa unit aktuasi listrik dan mekanik </li><li>Mengkalibrasi ulang perangkat tampilan </li><li>Memeriksa dan membersihkan pendingin oli transmisi secara visual </li><li>Memeriksa katup tabung injektor, cincin penyegelan poros dari poros input dan poros keluaran\r\n16.Memeriksa dan membersihkan rem take-in daya secara visual&nbsp;</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:39:40', 0, 23, '2022-09-01', 2),
