(28, '2022-01-09', 'P.202010101000/3B', 2, 4, 7, 8, 1, 3, 'TAIL SHAFT', 'Periksa shaft bagian luar BGA (oleh penyelam)', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Pembersihan dari pertumbuhan hewan laut pada shaft-shaft, flange-flange, tutup-\r\n        tutup kopling, bagian-bagian yang berputar  dan pelindung-pelindung kabel</li><li>Periksa propeller shaft dan anti-fouling coat </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:10:43', 0, 5, '2022-09-01', 1),
(29, '2022-01-09', 'P.202010102000/H', 2, 4, 7, 8, 1, 3, 'STERNTUBE SEAL', 'Periksa level air dan temperatur', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :</div><ol><li><span style=\"font-size: 1rem;\">Memastikan dalam proses pemeliharaan tidak merusak sealing ring</span></li><li>Cek suhu air maksimum tidak melebihi 40 derajat. Jika suhu lebih dari yang terukur, penyebabnya segera dicari dan tambahkan air pendingin bila perlu.</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 10:11:42', 0, 1, '2022-09-01', 1),
