(32, '2022-01-09', 'P.202010105000/M', 2, 4, 7, 8, 1, 9, 'RUDDER', 'Lumasi seal ring-seal ring bagian atas', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ul><li>Lumasi bagian atas seal ring di dalam interval mingguan dengan  jumlah ukuran pelumasan yang diijinkan gemuk sekitar 50 gram / minggu  </li></ul>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:12:32', 0, 2, '2022-09-01', 1),
(34, '2022-01-09', 'P.301010101000/H', 3, 5, 8, 9, 1, 3, 'FUEL OIL PUMP', 'Lakukan pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :</div><ol><li><span style=\"font-size: 1rem;\">Memastikan pompa tidak bergetar atau mengeluarkan suara yang menggelegar </span></li><li><span style=\"font-size: 1rem;\">Cek bahwa tidak ada kavitasi di dalam casing pompa </span></li><li><span style=\"font-size: 1rem;\">Cek slide bearings yang dilumasi itu terlumasi </span></li><li><span style=\"font-size: 1rem;\">Cek ball/roller bearings terbuka itu dilumasi </span></li><li><span style=\"font-size: 1rem;\">Cek bahwa ada cairan sehubungan dengan slide bearings yang dilumasi cairan </span></li><li><span style=\"font-size: 1rem;\">Cek bahwa setiap perangkat pelumas berfungsi dengan baik </span></li><li><span style=\"font-size: 1rem;\">Cek bahwa setiap pipa sirkulasi pipa pendingin, pemanas, atau air bertekanan berfungsi dengan baik </span></li><li><span style=\"font-size: 1rem;\">Cek output daya dan konsumsi daya itu benar </span></li><li><span style=\"font-size: 1rem;\">Cek aliran dan tekanan operasional itu benar </span></li><li><span style=\"font-size: 1rem;\">Cek bahwa maks. suhu yang diizinkan sesuai</span><br></li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 10:16:34', 0, 1, '2022-09-01', 1),
