(46, '2022-01-09', 'P.401010101000/2T', 4, 6, 10, 11, 1, 10, 'DG STX-Cummins QSM11DM', 'Pemeriksaan komponen  dan tambahkan tinggi  (level) coolant Sistem pendingin mesin Diesel Generator.', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa sistem Pendingin kemudian bersihkan, siram, dan isi kembali  air coolant </li><li>Periksa peredam getaran apakah ada bukti kehilangan cairan, penyok, dan goyah </li><li>Periksa Idler Pulley untuk Kebebasan rotasi, Retak, terkelupas, atau alur katrol rusak </li><li>Periksa Hub Kipas, Belt Driven </li><li>Periksa Turbocharger permukaan penyegelan rumah turbin untuk knalpot kebocoran, Jika ditemukan kebocoran, kencangkan mur penjepit V-band </li><li>Periksa Kompresor Udara  </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:15:17', 0, 9, '2022-09-01', 1),
(47, '2022-01-09', 'P.402010101000/H', 4, 7, 11, 12, 1, 2, 'DG DARURAT STX-Cummins 6BT5', 'Lakukan pemeriksaan komponen secara visual', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Lakukan pemeriksaan belt </li><li>Periksa level oli mesin </li><li>Periksa level cairan pendingin mesin </li><li>Periksa kipas \r\ndan sabuk penggerak </li><li>Periksa perangkap air bahan bakar </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 10:25:58', 0, 1, '2022-09-01', 1),
(48, '2022-01-09', 'P.402010101000/3B', 4, 7, 11, 12, 1, 2, 'DG DARURAT STX-Cummins 6BT5', 'Penggantian filter dan minyak pelumas', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Penggantian Minyak Pelumas </li><li>Penggantian Filter Pelumas </li><li>Pemeriksaan Pembersih Udara </li><li>Pemeriksaan Sistem Intake </li><li>Pemeriksaan Pendingin Udara Pengisian </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:12:00', 0, 5, '2022-09-01', 1),
(49, '2022-01-09', 'P.402010101000/6B', 4, 7, 11, 12, 1, 2, 'DG DARURAT STX-Cummins 6BT5', 'Pemeriksaan dan penggantian oli pelumas dan filter bahan bakar', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Penggantian oli Pelumas </li><li>Penggantian Filter oli Pelumas </li><li>Penggantian Filter Bahan Bakar </li><li>Pemeriksaan Pembersih Udara </li><li>Pemeriksaan Sistem Intake </li><li>Pemeriksaan Antibeku</li><li>Pemeriksaan Pendingin Udara Pengisian </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:16:42', 0, 7, '2022-09-01', 1),
(50, '2022-01-09', 'P.402010101000/T', 4, 7, 11, 12, 1, 2, 'DG DARURAT STX-Cummins 6BT5', 'Pemeriksaan komponen dan penggantian oli pelumas dan filter bahan bakar', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Penggantian oli Pelumas </li><li>Penggantian Filter oli Pelumas </li><li>Penggantian Filter Bahan Bakar </li><li>Sesuaikan Clearance Valve Lash2 </li><li>Periksa Pembersih Udara </li><li>Periksa Sistem asupan </li><li>Periksa Pendingin Udara Pengisian </li><li>Periksa Antibeku </li><li>Periksa Fan Hub </li><li>Periksa Bantalan Belt Tensioner </li><li>Periksa Ketegangan Belt </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:57:27', 0, 8, '2022-09-01', 1),
(51, '2022-01-09', 'P.402010101000/2T', 4, 7, 11, 12, 1, 2, 'DG DARURAT STX-Cummins 6BT5', 'Pemeriksaan sistem udara masuk dan penggantian filter dan oli pelumas', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Penggantian oli Pelumas </li><li>Penggantian Filter oli Pelumas </li><li>Penggantian Filter Bahan Bakar </li><li>Penggantian pendingin dan Antibeku </li><li>Periksa Pembersih Udara </li><li>Periksa Pendingin Udara Pengisian </li><li>Periksa Sistem Udara Masuk </li><li>Periksa Fan Hub </li><li>Periksa Bantalan Belt Tensioner </li><li>Periksa Ketegangan Belt </li><li>Periksa Peredam Getaran </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:15:59', 0, 9, '2022-09-01', 1),
(52, '2022-01-09', 'P.403010101000/3 B', 4, 8, 12, 13, 1, 10, 'BATERAI START', 'Periksa Kondisi dan sambungan-sambungan pada baterai', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa terminal, sekrup, klem dan kabel dari kerusakan atau sambungan yang kendor. Ini harus bersih, kencang dan bebas dari korosi</li><li>Pastikan bagian atas baterai bersih, kering, bebas dari kotoran dan debu</li><li>Cek voltase baterai, Jika voltase baterai berbeda dari rata-rata yang dikeluarkan lebih besar dari 0,49 V atau kurang dari 0,24 V segera service </li><li>Oleskan lapisan tipis gemuk suhu tinggi ke tiang dan sambungan kabel untuk perlindungan tambahan </li><li>Periksa kotak baterai untuk tanda-tanda kerusakan fisik, ganti jika sudah terjadi perubahan fisik  </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:12:50', 0, 5, '2022-09-01', 1),
(53, '2022-01-09', 'P.403010102000/T', 4, 8, 12, 13, 1, 10, 'BATERAI CHARGER', 'Periksa pasangan kabel dan bersihkan perangkat charger baterai', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa sambungan kabel ke baterai dari kerusakan dan korosi pada terminal charger </li><li>Bersihkan charger dari debu dan kotoran agar pengisi daya tetap bersih dan kering </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:57:51', 0, 8, '2022-09-01', 1),
(54, '2022-01-09', 'P.403010103000/20000JAM', 4, 8, 12, 13, 1, 11, 'UPS APC', 'Pemeriksaan secara visual', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Bersihkan UPS secara teratur, terutama intake dan exhaust ventilasi untuk menjaga ventilasi UPS tetap dalam kondisi baik. Jika diperlukan, gunakan penyedot debu untuk membersihkan </li><li>Periksa adakah ventilasi depan, belakang, panel samping panel, dan bagian bawah casing terhalang benda </li><li>Periksa untuk melihat apakah ada kesalahan yang terjadi, indikator kesalahan menyala atau alarm. Temukan penyebab jika indikator kesalahan menyala </li><li>Cek kondisi baterai dari kerusakan dengan cara Isi baterai selama 8 jam, lalu cek apakah baterai terisi penuh atau tidak </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:43:26', 0, 26, '2022-09-01', 2),
(55, '2022-01-09', 'P.404010101000/B', 4, 9, 13, 14, 1, 4, 'MAIN SWITCHBOARD PANEL', 'Melakukan inspeksi visual jika ada kerusakan secara mekanis maupun termal', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek indicator light &amp; holder, fuse &amp; holder</li><li>Cek baut-baut terminal kabel</li><li>Cek contact point control switch, protection contactor, safety protection SISTEM, push button dan amati apakah ada yang hangus</li><li>Cek sistem yang trip dan setting metering gauge</li><li>Cek bagian dalam dan luar panel, bersihkan dari debu dan perhatikan kelembaban panel </li></ol>', 'Tool box / Kunci perkakas, Megger 500 V, 100 M Ohm, Alat tes tegangan listrik, Obeng, dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:49:55', 0, 3, '2022-09-01', 1),
(56, '2022-01-09', 'P.404010101000/T', 4, 9, 13, 14, 1, 4, 'MAIN SWITCHBOARD PANEL', 'Melakukan pembersihan, pengencangan baut-baut dan tes fungsi alat dan sistem proteksi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek dan yakinkan tidak ada arus di daerah yang akan dimaintenance </li><li>Cek debu dan bersihkan dengan mini vacuum cleaner</li><li>Cek Baut-baut di terminal yang kendur supaya tidak timbul panas </li><li>Cek trip secara electric untuk meyakinkan apakah masih berfungsi normal atau tidak </li><li>Cek ACB, MCB, MCCB, bus bar, bracket insulation, cable joint, terminal, control switch, fuse base/holder, contactor-contactor, SISTEM protection, switch button, indicator light </li><li>Tambahkan grease sedikit pada bagian-bagian yang bergerak </li><li>Cek kondisi dari cable insulation, bus bar joint, pembatas antar phase, bracket  insulation </li><li>Cek auto protection SISTEM dari ACB, MCB, MCCB </li><li>Cek auto SISTEM &amp; manual SISTEM dari ACB, MCB, MCCB </li><li>Cek bracket dan megger tahanan insulation bus duct antar phase </li><li>Cek contact-contact point pada panel pembagi agar tidak ada yang hangus </li></ol>', 'Tool box / Kunci perkakas, Megger 500 V, 100 M Ohm, Alat tes tegangan listrik, Obeng, dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:58:42', 0, 8, '2022-09-01', 1),
(57, '2022-01-09', 'P.404010102000/B', 4, 9, 13, 14, 1, 4, 'EMERGENCY SWITCHBOARD PANEL', 'Melakukan inspeksi visual jika ada kerusakan secara mekanis maupun termal', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek indicator light &amp; holder, fuse &amp; holder</li><li>Cek baut-baut terminal kabel</li><li>Cek contact point control switch, protection contactor, safety protection SISTEM, push button dan amati apakah ada yang hangus</li><li>Cek sistem yang trip dan setting metering gauge</li><li>Cek bagian dalam dan luar panel, bersihkan dari debu dan perhatikan kelembaban panel </li></ol>', 'Tool box / Kunci perkakas, Megger 500 V, 100 M Ohm, Alat tes tegangan listrik, Obeng, dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:50:52', 0, 3, '2022-09-01', 1),
(58, '2022-01-09', 'P.404010102000/T', 4, 9, 13, 14, 1, 4, 'EMERGENCY SWITCHBOARD PANEL', 'Melakukan pembersihan, pengencangan baut-baut dan tes fungsi alat dan sistem proteksi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek dan yakinkan tidak ada arus di daerah yang akan dimaintenance </li><li>Cek debu dan bersihkan dengan mini vacuum cleaner</li><li>Cek Baut-baut di terminal yang kendur supaya tidak timbul panas</li><li>Cek trip secara electric untuk meyakinkan apakah masih berfungsi normal atau tidak </li><li>Cek ACB, MCB, MCCB, bus bar, bracket insulation, cable joint, terminal, control switch, fuse base/holder, contactor-contactor, SISTEM protection, switch button, indicator light </li><li>Tambahkan grease sedikit pada bagian-bagian yang bergerak </li><li>Cek kondisi dari cable insulation, bus bar joint, pembatas antar phase, bracket  insulation </li><li>Cek auto protection SISTEM dari ACB, MCB, MCCB </li><li>Cek auto SISTEM &amp; manual SISTEM dari ACB, MCB, MCCB </li><li>Cek bracket dan megger tahanan insulation bus duct antar phase </li><li>Cek contact-contact point pada panel pembagi agar tidak ada yang hangus </li></ol>', 'Tool box / Kunci perkakas, Megger 500 V, 100 M Ohm, Alat tes tegangan listrik, Obeng, dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:59:34', 0, 8, '2022-09-01', 1),
(59, '2022-01-09', 'P.404020101000/3B', 4, 9, 14, 15, 1, 12, 'LAMPU NAVIGASI', 'Periksa dan bersihkan lampu navigasi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek dan bersihkan rumah lampu (casing) dari kotoran dan karat, cek kekedapan rumah lampu dan pastikan tidak ada air yang masuk ke dalam casing lampu navigasi </li><li>Lakukan pemeriksaan nilai resistansi pada lampu navigasi untuk mengetahui kerusakan akibat terbentuknya korosi </li><li>Periksa semua gasket-gasket dan sambungan kabel </li><li>Periksa semua ulir dan baut sambungan </li><li>Bersihkan menggunakan kain halus dengan alkohol Reflektor dan front glass </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:13:27', 0, 5, '2022-09-01', 1),
(60, '2022-01-09', 'P.404020102000/6B', 4, 9, 14, 15, 1, 13, 'LAMPU SOROT KIRI', 'Periksa semua kabel-kabel dan penekan-penekan kabel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa semua gasket-gasket dan sambungan kabel </li><li>Periksa semua ulir dan baut sambungan </li><li>Bersihkan menggunakan kain halus dengan alkohol Reflektor dan front glass </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:17:11', 0, 7, '2022-09-01', 1),
(61, '2022-01-09', 'P.404020103000/6B', 4, 9, 14, 15, 1, 13, 'LAMPU SOROT KANAN', 'Periksa semua gasket dan penekan-penekan kabel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa semua gasket-gasket dan sambungan kabel </li><li>Periksa semua ulir dan baut sambungan </li><li>Bersihkan menggunakan kain halus dengan alkohol Reflektor dan front glass </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:18:22', 0, 7, '2022-09-01', 1),
(62, '2022-01-09', 'P.404030101000/H', 4, 9, 15, 16, 1, 14, 'SEA CHEST ANODE POKOK MGPS', 'Periksa daur hidup balok anode', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ul><li>Lakukan pengecekan status dari DPU. Jika menunjukkan tidak ada arus, cek pada primery dan secondary sekring di DPU\r\n </li></ul>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 10:27:06', 0, 1, '2022-09-01', 1),
(63, '2022-01-09', 'P.404030102000/H', 4, 9, 15, 16, 1, 15, 'UNIT PENGONTROL/TENAGA ICCP & MGPS', 'Periksa status DPU', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa jika anode terhubung dengan DPU </li><li>Periksa jika power terhubung dengan power supply terbaca dengan jelas pada DPU </li><li>Atur switch pada DPU ON. SISTEM akan bekerja secara automatik mengecek instalasi yang benar. Jika ada kesalahan dan bunyi alarm, lihat alarm LOG dan Troble shoting untuk segera diperbaiki</li><li>Posisikan switch rectifier OFF atau posisikan pada posisi operate. Catatan : Jika tanda tidak menunjuk/membaca, karena DPU belum terpasang cek dengan Ohmeter kemungkinan ada rangkaian yang tidak tersambung antara anoda dan badan kapal. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:00:59', 0, 1, '2022-09-01', 1),
(65, '2022-01-09', 'P.404030104000/4T', 4, 9, 15, 16, 1, 14, 'COFFERDAM REFERENCE ELECTRODE', 'Periksa elektroda acuan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ul><li>Uji / pengetesan kondisi dari Katodik Protecsion </li></ul>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:19:20', 0, 11, '2022-09-01', 1);
INSERT INTO `kartu_pemeliharaan` (`id`, `tanggal`, `kode_pemeliharaan`, `id_komponen_pokok`, `id_komponen_sub_pokok`, `id_sistem`, `id_sub_sistem`, `id_pelaksana`, `id_lokasi`, `komponen`, `uraian_pemeliharaan`, `tindakan_pengamanan`, `prosedur`, `alat_kerja`, `jo`, `created_at`, `updated_at`, `user_create`, `id_periode`, `tgl_mulai`, `id_jenis_perawatan`) VALUES
(66, '2022-01-09', 'P.501010101000/6B', 5, 10, 16, 17, 1, 3, 'EXHAUST MECHANICAL', 'Pembersihan dan pemeriksaan dari korosi dan kerusakan komponen lainnya, Lumasi Bantalan (Bearings)&nbsp;<br>', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa Kondisi Motor</li><li>Lumasi Bantalan (Bearings) dengan minyak, periksa kualitas minyak jika perlu diganti</li><li>Periksa dan Pastikan bantalan cukup terlindungi dari kontaminasi</li><li>Bersihkan Fan dan komponen SISTEM yang rentan terkontaminasi secara menyeluruh</li><li>Periksa kebocoran saluran yang dapat menyebabkan kehilangan energy dan performa SISTEM yang buruk</li><li>Periksa kualitas pasokan daya yang cukup ke penggerak motor</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:24:19', 0, 7, '2022-09-01', 1),
(67, '2022-01-09', 'P.501010101000/T', 5, 10, 16, 17, 1, 3, 'EXHAUST MECHANICAL', 'Lakukan pembersihan komponen exhaust&nbsp;', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Sebelum mulai membersihkan exhaust fan pastikan bahwa tidak ada arus listrik yang mengalir (saklar posisi off)</li><li>Bersihkan dengan menggunakan air dan detergen untuk membersihkan kisi-kisi, kemudian keringkan menggunakan kain</li><li>Sementara untuk motor exhaust fan, gunakan penyedot debu untuk membersihkannya</li><li>Bersihkan body exhaust dengan kain kering yang telah diberi sedikit air, kemudian bersihkan menggunakan kain kering kembali.</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:00:49', 0, 8, '2022-09-01', 1),
(68, '2022-01-09', 'P.501010102000/T', 5, 10, 16, 17, 1, 3, 'EXHAUST NATURAL', 'Pembersihan exhaust naturaal / ventilasi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Bersihkan ventilasi dari kotoran dan debu yang menempel </li><li>Periksa koneksi ventilator harus dalam kondisi kencang dan kuat </li><li>Periksa ventilator dari kerusakan fisik</li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:03:42', 0, 8, '2022-09-01', 1),
(69, '2022-01-09', 'P.501020101000/B', 5, 10, 17, 18, 1, 16, 'REFRIGERATION UNIT', 'Periksan dan bersihkan Refrigeration Unit', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa kondisi pompa sirkulasi Chiller bekerja dengan baik </li><li>Pastikan compressor chiller berjalan normal, periksa kondisi panel chiller dan pastikan tidak ada trouble pada chiller </li><li>Periksa dan catat Low Pressure dan High Pressure pada pressure gauge, untuk low pressure 35 – 50 psi dan high pressure antara 170 – 300 psi </li><li>Bersihkan chiller dari sampah-sampah/kotoran yang berada di sekitar area mesin chiller </li><li>Bersihkan panel listrik Chiller dengan hati-hati menggunakan selang angin. Semprotkan angin dengan jarak kurang lebih 30cm </li><li>Cek arus compressor pada Panel listrik Chiller, Gunakan tang ampere pada salah satu kabel sumber compressor. Catat hasilnya</li><li>Ukur temperature condensor. Untuk mengukur temperature condenser dapat menggunakan raytec. Catat hasilnya</li><li>Periksa expantion valve Chiller, Cek pipanya beku atau tidak. Bila terjadi kebekuan, maka setting ulang piston </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:51:44', 0, 3, '2022-09-01', 1),
(70, '2022-01-09', 'P.501020101000/4B', 5, 10, 17, 18, 1, 16, 'REFRIGERATION UNIT', 'Periksa tekanan freon dan pembersihan kondensor', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek tekanan Freon menggunakan manifold gauge, Pastikan tekanan freon tidak berlebih ataupun rendah</li><li>Bersihkan Condensor Chiller dari kerak yang menempel</li><li>Lakukan pengecekan pipa-pipa pendingin </li><li>Setting ulang temperature pada temperature control. Sesuaikan standar temperature dengan kebutuhan\r\n\r\n\r\n\r\n </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:14:56', 0, 6, '2022-09-01', 1),
(71, '2022-01-09', 'P.501020201000/H', 5, 10, 17, 19, 1, 3, 'AC SUPPLY PUMP DESMI', 'Pemeriksaan komponen pompa', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa dan pastikan pompa tidak bergetar atau mengeluarkan suara yang menggelegar</li><li>Periksa bahwa tidak ada kavitasi di dalam casing pompa </li><li>Periksa bantalan geser yang dilumasi itu terlumasi</li><li>Periksa bantalan bola / rol terbuka itu dilumasi </li><li>Pastikan bahwa ada cairan sehubungan dengan bantalan geser yang dilumasi cairan </li><li>Pastikan bahwa setiap perangkat pelumas berfungsi dengan baik </li><li>Pastikan bahwa setiap pipa sirkulasi - pipa pendingin, pemanas atau pipa air bertekanan berfungsi dengan baik </li><li>Periksa output daya dan konsumsi daya itu benar </li><li>Periksa aliran dan tekanan operasional itu benar </li><li>Periksa bahwa maks. suhu yang diizinkan diamati </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:02:09', 0, 1, '2022-09-01', 1),
(72, '2022-01-09', 'P.501020201000/M', 5, 10, 17, 19, 1, 3, 'AC SUPPLY PUMP DESMI', 'Pemeriksaan filter, segel poros dan bantalan pompa', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa agar filter dan lubang drainase bersih </li><li>Periksa bahwa kotak isian lunak bocor 10-100 tetes per menit </li><li>Periksa segel poros mekanis itu tidak bocor </li><li>Periksa bahwa lingkungan kotak isian dan bantalan bebas dari kotoran </li><li>Periksa apakah elemen penghubung fleksibel sudah aus. Diganti jika sudah aus </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:13:51', 0, 2, '2022-09-01', 1),
(73, '2022-01-09', 'P.501020201000/2B', 5, 10, 17, 19, 1, 3, 'AC SUPPLY PUMP DESMI', 'Pemeriksaan bantalan pompa dan katup bypass', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Pastikan agar bantalannya tidak terlalu banyak bermain </li><li>Pastikan bahwa katup bypass jika ada, berfungsi dengan benar dan terbuka pada tekanan yang tepat </li><li>Periksa bahwa kotak isiannya utuh Untuk dikemas atau dikemas ulang </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 12:00:52', 0, 4, '2022-09-01', 1),
