(75, '2022-01-09', 'P.501020202000/M', 5, 10, 17, 19, 1, 3, 'AC SUPPLY PUMP DESMI EMERGENCY', 'Pemeriksaan filter, segel poros dan bantalan pompa', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa agar filter dan lubang drainase bersih </li><li>Periksa bahwa kotak isian lunak bocor 10-100 tetes per menit </li><li>Periksa segel poros mekanis itu tidak bocor </li><li>Periksa bahwa lingkungan kotak isian dan bantalan bebas dari kotoran </li><li>Periksa apakah elemen penghubung fleksibel sudah aus. Diganti jika sudah aus </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:14:37', 0, 2, '2022-09-01', 1),
(76, '2022-01-09', 'P.501020202000/2B', 5, 10, 17, 19, 1, 3, 'AC SUPPLY PUMP DESMI EMERGENCY', 'Pemeriksaan bantalan pompa dan katup bypass', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Pastikan agar bantalannya tidak terlalu banyak bermain </li><li>Pastikan bahwa katup bypass jika ada, berfungsi dengan benar dan terbuka pada tekanan yang tepat </li><li>Periksa bahwa kotak isiannya utuh Untuk dikemas atau dikemas ulang </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 12:01:20', 0, 4, '2022-09-01', 1),
(77, '2022-01-09', 'P.502010101000/6B', 5, 11, 18, 20, 1, 5, 'FRESH WATER PUMP GRUNFOSS', 'Ganti bantalan pompa', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Perawatan untuk bantalan pompa dan segel poros pompa bebas dari perawatan </li><li>Ganti bantalan setelah 18000 Jam Oprasional Jika suhu lingkungan lebih rendah dari 40 derjat celcius </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:43:21', 0, 7, '2022-09-01', 1),
(78, '2022-01-09', 'P.502010101000/4000JAM', 5, 11, 18, 20, 1, 5, 'FRESH WATER PUMP GRUNFOSS', 'Ganti minyak pelumas', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ul><li>Beri pelumasan setiap 4000 Jam Oprasional Jika suhu lingkungan lebih rendah dari 40 derjat celcius </li></ul>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:37:58', 0, 21, '2022-09-01', 2),
(79, '2022-01-09', 'P.502010201000/H', 5, 11, 18, 21, 1, 5, 'SEA RECOVERY (RO)', 'Pemeriksaan secara visual unit U.V.', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa secara visual bagian luar unit UV untuk tanda-tanda kebocoran. Penyebab kebocoran harus ditemukan dan diperbaiki </li><li>Lakukan pemeriksaan lampu UV, Lampu UV \"ON\" ketika cahaya biru memancar melalui viewport </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:04:19', 0, 1, '2022-09-01', 1),
(80, '2022-01-09', 'P.502010201000/B', 5, 11, 18, 21, 1, 5, 'SEA RECOVERY (RO)', 'Pemeriksaan dan pembersihan unit U.V.', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa secara visual bagian luar unit UV untuk tanda-tanda kebocoran. Penyebab kebocoran harus ditemukan dan diperbaiki </li><li>Cek ground unit UV, pastikan ground uv terpasang dengan baik </li><li>Periksa kekedapan (pipa kedap air) dan segel mur kompresi </li><li>Bersihkan bagian luar unit UV menggunakan kain lembut dan air sabun, atau pembersih stainless steel komersial </li><li>Pastikan bagian luar unit UV bersih dan kering </li><li>Lakukan pemeriksaan lampu UV, Lampu UV \"ON\" ketika cahaya biru memancar melalui viewport </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:52:26', 0, 3, '2022-09-01', 1),
(81, '2022-01-09', 'P.502010201000/T', 5, 11, 18, 21, 1, 5, 'SEA RECOVERY (RO)', 'Lakukan penggantian Lampu U.V.', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Lepaskan keempat sekrup pada kotak ballast dan lepaskan tutupnya</li><li>Lepaskan boot karet dan tarik lampu dengan hati-hati dari quartz sleeve(selongsong kuarsa) </li><li>Ganti lampu. Selama penggantian lampu, bersihkan juga quartz sleeve(selongsong kuarsa) </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:04:21', 0, 8, '2022-09-01', 1),
(82, '2022-01-09', 'P.503010101000/H', 5, 12, 19, 22, 1, 3, 'POMPA BILGE/BALLAST DESMI', 'Lakukan pengecekan pompa temperatur, tekanan isap dan kebocoran', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek temperatur bantalan dan rumah pompa: Dapat dirasakan dengan tangan</li><li>Cek tekanan isap dan tekanan keluar dengan melihat penunjukan manometer dan vakummeter </li><li>Cek kebocoran dari kotak packing, amati secara visual </li><li>Cek Arus Listrik, lihat pada amperemeter </li><li>Cek jumlah minyak pelumas di dalam rumah bantalan dan perputaran cincin minyak </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:05:11', 0, 1, '2022-09-01', 1),
(83, '2022-01-09', 'P.503010101000/6B', 5, 12, 19, 22, 1, 3, 'POMPA BILGE/BALLAST DESMI', 'Pemeriksaan tahanan isolasi dan grease', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Pemeriksaan tahanan isolasi pada motor pompa </li><li>Pemeriksaan atau pergantian minyak di dalam rumah bantalan </li><li>Pemeriksaan grease (gemuk)pada bearing pompa, grease harus diganti jika kondisinya memburuk</li><li>Pemeriksaan packing tekan dan selubung poros, jika pada selubung poros terlihat alur-alur dalam karena aus, packing dan selubung poros harus diganti. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:44:13', 0, 7, '2022-09-01', 1),
(84, '2022-01-09', 'P.503010101000/5T', 5, 12, 19, 22, 1, 3, 'POMPA BILGE/BALLAST DESMI', 'Pengecekan keausan komponen dan pemberishan korosi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek keausan pada bagian-bagian yang berputar </li><li>Cek dan bersihkan korosi didalam rumah pompa </li><li>Melepas impeller, dan periksa ukuran impeller dan alur pasaknya, pastikan pasak benar–benar pas dan tidak goyang </li><li>Cek kelurusan poros, harus dilakukan pelurusan kembali setelah pompa dibongkar dan dipasang</li><li>Cek tahanan isolator motor, ukur kembali setelah pembongkaran ataupun pemasangan kembali. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:20:18', 0, 12, '2022-09-01', 1),
(85, '2022-01-09', 'P.503010102000/6B', 5, 12, 19, 22, 1, 3, 'BILGE PUMP (SUBMERSIBLE)', 'Pemeriksaan dan pembersihan komponen komponen pompa dan koneksi kabel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Membersihkan komponen-komponen untuk kontrol pompa dari kotoran lalu memeriksa pemasangan dan penyambungan kabel jika ada, pastikan kabel tersambung dengan baik </li><li>Membersihkan bagian impeller pompa dari kotoran dengan memeriksa kondisi putaran impeller dan bersihkan jika terdapat benda-benda asing yang tersangkut </li><li>Cek baut-baut yang kendor pada sambungan pemipaan, kencangkan baut-baut maupun komponen Iainnya yang terlihat kendor dengan menggunakan kunci inggris maupun kunci pipa </li><li>Memeriksa apakah terdapat kebocoran pada pompa dengan mengecek casing pompa apakah terjadi kerusakan seperti retak maupun lecet yang bisa menyebabkan air masuk ke motor pompa</li><li>Memeriksa koneksi kabelnya seperti kabel untuk suplai tegangan dan juga untuk water level control (WLC). Setelah selesai, beri tegangan pada pompa dengan menaikkan MCB induk dan memastikan pompa berfungsi dengan baik </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:45:01', 0, 7, '2022-09-01', 1),
