(87, '2022-01-09', 'P.503010201000/6B', 5, 12, 19, 23, 1, 5, 'POMPA SANITARY DESMI', 'Pemeriksaan tahanan isolasi dan grease', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Pemeriksaan tahanan isolasi pada motor pompa </li><li>Pemeriksaan atau pergantian minyak di dalam rumah bantalan </li><li>Pemeriksaan grease (gemuk)pada bearing pompa, grease harus diganti jika kondisinya memburuk</li><li>Pemeriksaan packing tekan dan selubung poros, jika pada selubung poros terlihat alur-alur dalam karena aus, packing dan selubung poros harus diganti. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:45:55', 0, 7, '2022-09-01', 1),
(88, '2022-01-09', 'P.503010201000/5T', 5, 12, 19, 23, 1, 5, 'POMPA SANITARY DESMI', 'Pengecekan keausan komponen dan pemberishan korosi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek keausan pada bagian-bagian yang berputar</li><li>Cek dan bersihkan korosi didalam rumah pompa </li><li>Melepas impeller, dan periksa ukuran impeller dan alur pasaknya, pastikan pasak benar–benar pas dan tidak goyang </li><li>Cek kelurusan poros, harus dilakukan pelurusan kembali setelah pompa dibongkar dan dipasang</li><li>Cek tahanan isolator motor, ukur kembali setelah pembongkaran ataupun pemasangan kembali. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:21:10', 0, 12, '2022-09-01', 1),
(89, '2022-01-09', 'P.503010202000/6B', 5, 12, 19, 23, 1, 5, 'SANITARY PUMP SHOWFU', 'Pemeriksaan dan pembersihan komponen komponen pompa dan koneksi kabel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Membersihkan komponen-komponen untuk kontrol pompa dari kotoran lalu memeriksa pemasangan dan penyambungan kabel jika ada, pastikan kabel tersambung dengan baik</li><li>Membersihkan bagian impeller pompa dari kotoran dengan memeriksa kondisi putaran impeller dan bersihkan jika terdapat benda-benda asing yang tersangkut </li><li>Cek baut-baut yang kendor pada sambungan pemipaan, kencangkan baut-baut maupun komponen Iainnya yang terlihat kendor dengan menggunakan kunci inggris maupun kunci pipa </li><li>Memeriksa apakah terdapat kebocoran pada pompa dengan mengecek casing pompa apakah terjadi kerusakan seperti retak maupun lecet yang bisa menyebabkan air masuk ke motor pompa</li><li>Memeriksa koneksi kabelnya seperti kabel untuk suplai tegangan dan juga untuk water level control (WLC). Setelah selesai, beri tegangan pada pompa dengan menaikkan MCB induk dan memastikan pompa berfungsi dengan baik </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:47:42', 0, 7, '2022-09-01', 1),
(90, '2022-01-09', 'P.503020101000/H', 5, 12, 20, 24, 1, 5, 'SEWAGE TREATMENT PLANT ECOMAR', 'Pemeriksaan secara menyeluruh sistem STP', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Pemeriksaan secara menyeluruh semua sistem STP ECOmar </li><li>Periksa level produk kimia tangki Hidrogen Peroksida dan tangki ECOFLOC, Level tidak boleh di bawah 10 cm. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:06:49', 0, 1, '2022-09-01', 1),
(91, '2022-01-09', 'P.503020101000/B', 5, 12, 20, 24, 1, 5, 'SEWAGE TREATMENT PLANT ECOMAR', 'Lakukan inspeksi Air intake', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Tambahkan produk kimia pada tangki Hidrogen Peroksida dan tangki ECOFLOC jika perlu, Level tidak boleh di bawah 10 cm </li><li>Periksa asupan udara jika udara dilepaskan dengan benar </li><li>Periksa pemasukan udara agar pemasukan udara tidak terhalang </li><li>Periksa asupan udara jika pipa knalpot lurus dalam dimensi vertikal </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:53:21', 0, 3, '2022-09-01', 1),
(92, '2022-01-09', 'P.503020101000/2B', 5, 12, 20, 24, 1, 5, 'SEWAGE TREATMENT PLANT ECOMAR', 'Pembersihan probe apung dan inspeksi Dosing pump', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Lepaskan dan bersihkan probe apung, yang dipasang di tangki perawatan</li><li>Inspeksi Dosing pump dari suction ball, check valve dan discharge ball check valve </li><li>Cek Dosing pumps dari obstruksi bersihkan katup dengan air bersih</li><li>Cek Dosing pompa dari korosi, ganti katup jika perlu </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 12:01:54', 0, 4, '2022-09-01', 1),
(93, '2022-01-09', 'P.503020101000/3B', 5, 12, 20, 24, 1, 5, 'SEWAGE TREATMENT PLANT ECOMAR', 'Lakukan inspeksi Stainless Steel dan fitting PVC', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Lakukan inspeksi Stainless Steel dan fitting PVC </li><li>Jika Fitting Stainless Steel dan PVC ada kebocoran, kencangkan dengan benar dengan alat khusus </li><li>Bersihkan Probe Level yang Disediakan(di dalam tangki pengumpul) kontak dengan kertas abrasif </li><li>Kosongkan ruang radiasi sistem, lepaskan tabung dan bersihkan atau ganti tabung U.V. Sistem Sterilisasi jika perlu. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:13:56', 0, 5, '2022-09-01', 1),
(94, '2022-01-09', 'P.503020101000/6B', 5, 12, 20, 24, 1, 5, 'SEWAGE TREATMENT PLANT ECOMAR', 'Perawatan pompa Filling pump, Macerating pump, Seawater pump dan Discharge pump', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Setel ulang sakelar tekanan yang dipasang pada flensa tangki perawatan </li><li>Lepaskan jet inspeksi. flens dan cuci dengan tangki Perawatan jet air langsung </li><li>Lakukan prosedur pencucian balik Stasiun Filter Multimedia </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:48:56', 0, 7, '2022-09-01', 1),
(95, '2022-01-09', 'P.503020101000/T', 5, 12, 20, 24, 1, 5, 'SEWAGE TREATMENT PLANT ECOMAR', 'Bersihkan Filter Sistem Sterilisasi U.V.', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Buka bak filter, keluarkan tas kartrid dan kosongkan </li><li>Cuci rumah dan tas kartrid </li><li>Pasang kembali atau ganti tas kartrid </li><li>Kosongkan ruang radiasi sistem, lepaskan lampu pembasmi kuman dan ganti lampu, jika perlu. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:05:56', 0, 8, '2022-09-01', 1),
(96, '2022-01-09', 'P.503020101000/5T', 5, 12, 20, 24, 1, 5, 'SEWAGE TREATMENT PLANT ECOMAR', 'Lakukan perbaikan atau penggantian pompa', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ul><li>Lakukan perbaikan atau penggantian pompa Filling, pompa Macerating, pompa Discharge </li></ul>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:23:14', 0, 12, '2022-09-01', 1),
(97, '2022-01-09', 'P.503020201000/6B', 5, 12, 20, 25, 1, 17, 'JETS ACCUMULATOR', 'Lakukan pembersihan  klep NR dan sambungan pipa karet', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ul><li>Bersihkan  klep NR dan sambungan pipa karet untuk suply vacuum  ke kontrol klep  </li></ul>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:49:22', 0, 7, '2022-09-01', 1),
(98, '2022-01-09', 'P.503030101000/B', 5, 12, 21, 26, 1, 3, 'OILY WATER SEPARATOR', 'Lakukan pembersihan OWS dari kotoran', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Lakukan pembilasan pada Oil Water Separator dengan menjalankan pompa Bilge dan buka keran By-Pass agar bersikulasi ke Bilge Tank </li><li>Bersihkan endapan yang memasuki OWS dengan pencucian uap atau mebersihkan dan mengganti lapisan dalam yang rusak </li><li>Bersihkan kotoran minyak yang tersisa pada kedua tabung separator secara berkala </li><li>Lakukan Perawatan oil content monitor dan solenoid valve, dengan melaksanakan SOP pembersihan atau flushing pipa – saluran </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:57:59', 0, 3, '2022-09-01', 1),
(99, '2022-01-09', 'P.503030101000/6B', 5, 12, 21, 26, 1, 3, 'OILY WATER SEPARATOR', 'Lakukan perawatan atau pembersihan saringan dan penggantian komponen jika ada kerusakan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Perawatan pada saringan-saringan dan filter harus dalam keadaan bersih sebelum dan sesudah pemakaian</li><li>Lakukan penggantian Multi Level Pararel Jika aus atau rusak </li><li>Lakukan penggantian Selenoid Valve Jika aus atau rusak </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:50:15', 0, 7, '2022-09-01', 1),
(100, '2022-01-09', 'P.503030101000/T', 5, 12, 21, 26, 1, 3, 'OILY WATER SEPARATOR', 'Lakukan penggantian komponen OWS', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Lakukan penggantian komponen Saringan Bentuk T Jika aus atau rusak </li><li>Lakukan penggantian komponen Non Return Valve Jika aus atau rusak </li><li>Lakukan penggantian komponen Katup Globe Jika aus atau rusak </li><li>Lakukan penggantian komponen Saringan Bentuk Y Jika aus atau rusak </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:06:33', 0, 8, '2022-09-01', 1),
(101, '2022-01-09', 'P.504010101000/T', 5, 13, 22, 27, 1, 18, 'FIN STABILIZER HUMPHREE', 'Periksa dan bersihkan FIN STABILIZER', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa kabel dan semua konektor untuk tanda-tanda korosi</li><li>Priksa Interceptor secara visual untuk setiap kerusakan</li><li>Perpanjang blades menggunakan panel kontrol dan periksa, Bersihkan jika diperlukan. Setelah pemeriksaan, tarik kembali blades </li><li>Lakukan kalibrasi untuk mengukur torsi unit servo. Ini dilakukan di panel kontrol, lihat kalibrasi servo </li><li>Torsi yang disajikan di panel kontrol di bawah informasi sistem / unit sistem / HCU / servo / torsi kalibrasi: harus di bawah 18Nm. (torsi poros 12Nm + gigi servo 6Nm). Jika torsi yang lebih tinggi diukur, komponen sistem akan mengalami keausan yang berlebihan. Dalam kasus seperti itu, periksa komponen bergerak Interceptor untuk kemungkinan kerusakan, pertumbuhan atau kontaminasi laut (pasir, endapan lumpur, dll.). Lepaskan unit servo dan periksa porosnya torsi. Torsi poros harus di bawah 12Nm </li><li>Kalibrasi ulang lagi untuk memeriksa bahwa torsi di bawah batas. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:07:14', 0, 8, '2022-09-01', 1),
(102, '2022-01-09', 'P.505010101000/H', 5, 14, 23, 28, 1, 19, 'MAIN FIRE PUMP DESMI', 'Lakukan pengecekan pompa temperatur, tekanan isap dan kebocoran', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek temperatur bantalan dan rumah pompa: Dapat dirasakan dengan tangan</li><li>Cek tekanan isap dan tekanan keluar dengan melihat penunjukan manometer dan vakummeter </li><li>Cek kebocoran dari kotak packing, amati secara visual </li><li>Cek Arus Listrik, lihat pada amperemeter </li><li>Cek jumlah minyak pelumas di dalam rumah bantalan dan perputaran cincin minyak </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:07:36', 0, 1, '2022-09-01', 1),
