(108, '2022-01-09', 'P.505010301000/M', 5, 14, 23, 30, 1, 20, 'FIX FIRE EXTINGUISHER CYLINDER', 'Periksa katup dan level tanki', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa semua katup untuk kebebasannya dan periksa apakah posisinya benar, baik biasanya terbuka atau tertutup </li><li>Periksa apakah tanda pada katup terlihat </li><li>Periksa level tangki penyimpanan cairan busa </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:15:56', 0, 2, '2022-09-01', 1),
(109, '2022-01-09', 'P.505010301000/B', 5, 14, 23, 30, 1, 20, 'FIX FIRE EXTINGUISHER CYLINDER', 'Periksa suplai listrik ke pompa cairan busa dan cek kebocoran katup', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa apakah suplai listrik ke pompa cairan busa normal </li><li>Nyalakan pompa kebakaran dan sejajarkan air ke hidran busa </li><li>Periksa apakah katup isolasi menahan dan pastikan tidak ada jejak busa yang keluar </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:58:32', 0, 3, '2022-09-01', 1),
(110, '2022-01-09', 'P.505010301000/6B', 5, 14, 23, 30, 1, 20, 'FIX FIRE EXTINGUISHER CYLINDER', 'Tes dan jalankan sistem fix fire extinguisher cylinder sistem', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Jalankan sistem selama 3 menit dan pastikan busa yang dihasilkan sesuai </li><li>Periksa pewarna cairan busa dan bersihkan bila perlu </li><li>Periksa semua monitor untuk pergerakan bebas </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:51:58', 0, 7, '2022-09-01', 1),
(111, '2022-01-09', 'P.505010301000/T', 5, 14, 23, 30, 1, 20, 'FIX FIRE EXTINGUISHER CYLINDER', 'Memberikan pelumasan/grease pada motor pompa busa', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Pastikan Motor pompa busa untuk dilumasi </li><li>Kirim sampel busa untuk dianalisis </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:07:51', 0, 8, '2022-09-01', 1),
(112, '2022-01-09', 'P.505010302000/6B', 5, 14, 23, 30, 1, 20, 'ALAT PEMADAM AF11 6 KG', 'Periksa alat pemadam', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek segel di tabung Cartridge yg berada di leher tabung, apakah masih dalam keadaan utuh </li><li>Bersihkan tabung dari debu, air, maupun korosi dengan menggosok tabung dgn kain basah lalu gosok lagi dgn kain kering, setelah itu oleskan sedikit solar pada body tabung secara merata</li><li>Bolak-balikan tabung guna menghindari pembekuan pada cairan dalam tabung. Caranya, satu tangan memegang bagian atas tabung, dan tangan satunya lagi memegang bagian bawah tabung. Lalu bagian atas tabung dibalik ke bawah dan sebaliknya, bagian bawah tabung dibolak ke atas. Lakukan hingga 3 sampai 5 kali secara perlahan </li><li>Pastikan Valve, Selang, Meter Pressure dan Segel dalam keadaan baik</li><li>Yakinkan posisi Bracket dalam keadaan kuat dan melekat sempurna dgn dinding </li><li>Usahakan agar tabung terhindar dari kontak langsung matahari dan hujan, disarankan untuk memberi pelindung pada tabung demi menjaga kualitas tabung lebih tahan lama </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:52:46', 0, 7, '2022-09-01', 1),
(113, '2022-01-09', 'P.505010401000/T', 5, 14, 23, 31, 1, 20, 'SMOKE & FIRE DETECTOR', 'Periksa detektor asap/panas secara teknis', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Kalibrasi dan uji sensor alarm kebakaran, termasuk detektor sensor asap, panas, percikan dan lainnya terhadap nyala api </li><li>Cek dan bersihkan elemen kisi udara dari sumbatan debu, karena bisa mengakibatkan berkurangnya sensitifitas detector </li><li>Uji suara alarm kebakaran dan melakukan simulasi. Hal ini memerlukan petunjuk yang sangat spesifik dan sebaiknya diserahkan kepada orang-orang yang profesional</li><li>Mengatur sensitivitas alarm kebakaran itu dengan mengikuti panduan dan instruksi dari brand yang dipasang </li><li>Lakukan pergantian baterai alarm kebakaran dan uji input alarm kebakaran dengan layanan darurat </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:08:27', 0, 8, '2022-09-01', 1),
(114, '2022-01-09', 'P.505020101000/B', 5, 14, 24, 32, 1, 22, 'LIFE RAFT PENYELAMAT', 'Cek kondisi dan pendukung life raft', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Pastikan peti kemas diikat secara benar ke ayunan nya dan tidak memiliki retak-retak atau tempat yang tidak kuat (lemah) </li><li>Pastikan peti kemas pengamanan tali pengikat tidak memiliki potong-potong dan masih kuat </li><li>Pastikan garis pelukis tidak dirusakkan dan itu masih dijamin aman </li><li>Pemeriksaan kawat winch, sheaves dan slewing gear untuk memastikan pelumasan yang memadai, bebas dari korosi dan cat yang berlebihan </li><li>Pastikan casing rakit tidak menunjukkan tanda-tanda kerusakan  </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 11:59:13', 0, 3, '2022-09-01', 1),
(115, '2022-01-09', 'P.505020102000/6B', 5, 14, 24, 32, 1, 23, 'SEKOCI', 'Periksa dan bersihkan sekoci', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cuci bersihkan sekoci agar tidak ada sampah, pasir atau kotoran yang menempel. Keringkan lalu taburkan bedak (bisa menggunakan bedak apa saja) agar sekoci tetap kering, tutup kembali sekoci dengan cover bag</li><li>Cek sekoci dari kerusakan atau kebocoran, segera perbaiki jika ada kerusakan atau kebocoran dengan Repair Kit </li><li>Cek mesin sekoci dan tes gerakan maju dan mundur, setidaknya dalam waktu 3 menit. Pada saat pengecekan ini perlu diperiksa apakah mesin bekerja dengan semestinya</li><li>Laksankan pelumasan points  </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:53:54', 0, 7, '2022-09-01', 1),
(116, '2022-01-09', 'P.505020103000/T', 5, 14, 24, 32, 1, 24, 'LIFE JACKET', 'Periksa secara visual Life Jacket dan peralatan pendukung', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa Life Jacket dari kerusakan dan kebocoran </li><li>Cuci dan bersihkan life jacket dari kotoran dan debu yang menempel </li><li>Periksa kelayakan dan fungsi </li><li>Periksa kelengkapan seperti lampu, fluit, reflektor dan lakukan tes fungsi </li><li>Bersihkan box penyimpanan life jacket </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:09:01', 0, 8, '2022-09-01', 1),
(117, '2022-01-09', 'P.505020104000/3T', 5, 14, 24, 32, 1, 25, 'LIFE  BOUY', 'Periksa life buoy dan peralatan pendukung', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa lifebuoy dari tanda-tanda kerusakan. Jika ada kerusakan lakukan perbaikan, ganti jika perlu </li><li>Lakukan pengecatan ulang jika warna cat sudah mulai pudar </li><li>Periksa masa pakai baterai lampu lifebuoy, jika sudah melewati 3 tahun lakukan penggantian dengan yang baru </li><li>Uji lampu lifebuoy dengan menarik keluar klip dengan hati-hati dan biarkan kepala lampu tegak, dan kemudian lampu lifebuoy harus berkedip sekaligus. Dan letakkan kepala lampu ke bawah, dan kemudian akan berhenti berkedip juga. Kemudian ganti lampu lifebuoy kembali ke klip. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:17:45', 0, 10, '2022-09-01', 1),
(118, '2022-01-09', 'P.505020105000/T', 5, 14, 24, 32, 1, 26, 'EMERGENCY ESCAPE BREATHING', 'Lakukan pemeriksaan komponen EEBD dan sensor', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa pengukur silinder untuk memastikan berada dalam kisaran tekanan yang benar </li><li>Uji hidrostatik dan pemeriksaan internal silinder </li><li>Cek sensor kelembaban untuk mengetahui hilangnya segel vakum dengan cara melihat perubahan warna dari biru muda menjadi putih atau merah muda </li><li>Lakukan inspeksi untuk memastikan bahwa perangkat belum rusak, kehilangan segel vakum, atau melebihi masa simpannya.  </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:09:31', 0, 8, '2022-09-01', 1),
(119, '2022-01-09', 'P.506010101000/2B', 5, 15, 25, 33, 1, 3, 'COMPRESSOR MODIC', 'Pemeriksaan dan penggantian minyak pelumas', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Pastikan pressure switch bekerja secara normal, kompresor akan mati ketika tekanan sudah mencapai 0,7 Mpa dan akan hidup kembali ketika tekanan udara turun mencapai 0,5 Mpa </li><li>Pastikan safety valve kompresor bekerja secara normal, dengan menariknya sebentar dan udara bertekanan dapat keluar jika tekanan udara melebihi standar </li><li>Pemeriksaan pembuangan valve/separator menggunakan manual drain valve </li><li>Periksa V-belt, dan pastikan v-belt sesuai standar, yaitu tidak terlalu kendur dan tidak terlalu kencang, serta dalam keadaan baik (tidak slip dan tidak pecah-pecah/ putus) </li><li>Bersihkan filter masuknya udara (air intake filter) dari debu. Debu yang menempel pada filter dapat menyebabkan  kompresor bekerja lebih keras dari seharusnya </li><li>Pastikan tidak ada kebocoran pada pipa, selang dan lain sebagainya. Karena jika ada kebocoran walaupun sedikit dapat menurunkan kualias tekanan udara yang dihasilkan kompresor </li><li>Pastikan tidak ada abnormal sound, contohnya seperti suara bearing motor penggerak yang rusak, suara v-belt yang slip, suara kebocoran, dan suara-suara tidak normal lainnya </li><li>Selalu ganti oli kompresor setiap 2000 jam pengoperasian\r\n9.Pastikan kompresor selalu dalam keadaan bersih agar terhindar dari karat </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 12:02:41', 0, 4, '2022-09-01', 1),
(120, '2022-01-09', 'P.507010101000/8JAM', 5, 16, 26, 34, 1, 27, 'CRANE FASSI F85B', 'Pengecekan komponen crane hidrolik', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Cek Tangki oli dan Pedestal untuk kekencangan Baut dan strukturnya </li><li>Cek Electric Motor untuk kekencangan baut, komponen listrik dan kinerja/putaran </li><li>Cek Kinerja pompa hidrolik, cek pressure hidrolik </li><li>Cek kondisi Panel Listrik dalam keadaan baik, tidak ada sambungan kabel yang kendur/terlepas </li><li>Cek Drive Coupling Hydraulic </li><li>Cek Filler pengisian udara Hidrolik </li><li>Cek Pengukur Tekanan Hidrolik </li><li>Cek Return Filter Element Pada Tiap-tiap 1000 Jam Operasi atau Ketika Kotor/Tersumbat, Rusak </li><li>Cek Suction Filter/Pressure Filter Pada Tiap-tiap 1000 Jam Operasi </li><li>Cek Level Oli Tangki Hidrolik, level minimum adalah ½ Level Gauge. Tambahkan Bila kurang </li><li>Periksa Pipa, Selang dan Katup Hidrolik </li><li>Cek Oli Pelumas Hidrolik ISO VG 68 Tambahkan Bila kurang, (Minimum ½ Level Gauge) </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:30:23', 0, 15, '2022-09-01', 2),
(121, '2022-01-09', 'P.507010102000/50JAM', 5, 16, 26, 34, 1, 27, 'CRANE FASSI F85B', 'Perawatan dan bersihkan komponen crane hidrolik', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Perawatan atau penggantian pressure crane hidrolik </li><li>Bersihkan Panel Listrik hidrolik, memastikan tidak ada sambungan kabel yang kendur/terlepas. Ganti jika ada </li><li>Perawatan atau penggantian Drive Coupling Hydraulic </li><li>Perawatan atau penggantian Filler pengisian udara Hidrolik </li><li>Perawatan atau penggantian Pengukur Tekanan Hidrolik </li><li>Perawatan atau penggantian Return Filter Element Pada Tiap-tiap 1000 Jam Operasi atau Ketika Kotor/Tersumbat, Rusak </li><li>Perawatan atau penggantian Suction Filter/Pressure Filter Pada Tiap-tiap 1000 Jam Operasi </li><li>Perawatan atau penggantian Level Oli Tangki Hidrolik, level minimum adalah ½ Level Gauge. Tambahkan Bila kurang </li><li>Perawatan atau penggantian Pipa, Selang dan Katup Hidrolik </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:31:38', 0, 16, '2022-09-01', 2);
INSERT INTO `kartu_pemeliharaan` (`id`, `tanggal`, `kode_pemeliharaan`, `id_komponen_pokok`, `id_komponen_sub_pokok`, `id_sistem`, `id_sub_sistem`, `id_pelaksana`, `id_lokasi`, `komponen`, `uraian_pemeliharaan`, `tindakan_pengamanan`, `prosedur`, `alat_kerja`, `jo`, `created_at`, `updated_at`, `user_create`, `id_periode`, `tgl_mulai`, `id_jenis_perawatan`) VALUES
(122, '2022-01-09', 'P.507010103000/1000JAM', 5, 16, 26, 34, 1, 27, 'CRANE FASSI F85B', 'Perawatan, penggantian dan pelumasan komponen crane hidrolik', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Perawatan atau penggantian pressure crane hidrolik </li><li>Bersihkan Panel Listrik hidrolik, memastikan tidak ada sambungan kabel yang kendur/terlepas. Ganti jika ada </li><li>Perawatan atau penggantian Drive Coupling Hydraulic </li><li>Perawatan atau penggantian Filler pengisian udara Hidrolik </li><li>Perawatan atau penggantian Pengukur Tekanan Hidrolik </li><li>Penggantian Return Filter Element Pada Tiap-tiap 1000 Jam Operasi atau Ketika Kotor/Tersumbat, Rusak </li><li>Penggantian Suction Filter/Pressure Filter Pada Tiap-tiap 1000 Jam Operasi </li><li>Perawatan atau penggantian Level Oli Tangki Hidrolik, level minimum adalah ½ Level Gauge. Tambahkan Bila kurang </li><li>Perawatan atau penggantian Pipa, Selang dan Katup Hidrolik </li><li>Penggantian Oli Pelumas Hidrolik ISO VG 68  </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:35:32', 0, 19, '2022-09-01', 2),
(123, '2022-01-09', 'P.507010104000/10000JAM', 5, 16, 26, 34, 1, 27, 'CRANE FASSI F85B', 'Penggantian komponen crane hidrolik', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Perawatan atau penggantian pressure hidrolik </li><li>Bersihkan Panel Listrik hidrolik, memastikan tidak ada sambungan kabel yang kendur/terlepas. Ganti jika ada </li><li>Perawatan atau penggantian Drive Coupling Hydraulic </li><li>Perawatan atau penggantian Filler pengisian udara Hidrolik </li><li>Perawatan atau penggantian Pengukur Tekanan Hidrolik </li><li>Penggantian Return Filter Element Pada Tiap-tiap 1000 Jam Operasi atau Ketika Kotor/Tersumbat, Rusak</li><li>Penggantian Suction Filter/Pressure Filter Pada Tiap-tiap 1000 Jam Operasi </li><li>Penggantian Level Oli Tangki Hidrolik, level minimum adalah ½ Level Gauge. Tambahkan Bila kurang </li><li>Penggantian Pipa dan Selang Hidrolik\r\n10.Penggantian Oli Pelumas Hidrolik ISO VG 68  </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 16:40:28', 0, 23, '2022-09-01', 2),
(124, '2022-01-09', 'P.507020101000/6B', 5, 16, 27, 35, 1, 5, 'HPU WINDLASS', 'Bersihkan dan periksa komponen dari kerusakan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Lepaskan penggulung dan roda rantai dari Poros Utama </li><li>Periksa semua segel dan ganti jika perlu</li><li>Bersihkan semua komponen, periksa apakah ada kerusakan dan keausan yang berlebihan, lumasi kembali dan pasang kembali</li><li>Gunakan gemuk tahan air untuk roda gigi dan ulir pada Roda gigi yang digerakkan, Aktuator Kopling, dan es-Q-Steel untuk ulir sekrup, Poros Utama dan Kunci</li><li>Bersihkan dan lumasi kembali ulir pada rem band </li><li>Periksa komponen di bawah dek, periksa terutama untuk korosi, cat terkelupas dll, bersihkan, dan cat jika diperlukan. </li></ol>', 'Tool box / Kunci perkakas, Lampu penerangan, Kain lap, Panduan service(Kartu SPT), dll.', '0', '2022-09-01 08:00:00', '2022-06-29 15:54:33', 0, 7, '2022-09-01', 1),
(125, '2022-01-09', 'P.507020101000/T', 5, 16, 27, 35, 1, 6, 'HPU WINDLASS', 'Pemeriksaan komponen dan pengencangan sekrup', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Periksa dan bersihkan semua permukaan luar dan saluran udara ke peredam roda gigi agar pendinginan tetap efektif sepenuhnya</li><li>Periksa tingkat minyak pelumas dan kerusakan komponen </li><li>Kencangkan semua sekrup pada windlass</li><li>Periksa tingkat kebisingan, getaran, dan penyegelan secara berkala </li></ol>', 'Kompressor udara untuk pengecatan, Kunci-kunci, Lap kering, Kuas', '0', '2022-09-01 08:00:00', '2022-06-29 16:10:04', 0, 8, '2022-09-01', 1),
(126, '2022-01-09', 'P.507020201000/T', 5, 16, 27, 35, 1, 29, 'JANGKAR', 'Pembersihan dan pelapisan jangkar dari karat', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Bersihkan jangkar kapal yang telah digunakan agar terbebas dari lumpur atau kotoran lain</li><li>Pelumasan bahan anti karat pada permukaan jangkar kapal. Pelumasan bisa dilakukan dengan bahan yang sesuai, untuk bahan besi seperti varmasin </li><li>Memberikan lapisan pada pipa yang telah dicat dengan cat anti karat atau korosif. Bisa juga dengan memberikan lapisan timah seperti pada kaleng</li><li>Jika telah terjadi karat, cara untuk menghilangkan lapisan karat tersebut dengan diketok, dibersihkan dengan amplas untuk menghilangkan sisa kotoran yang terdapat pada permukaan jangkar, lalu dicat dengan dengan cat anti karat. </li></ol>', 'Kompressor udara untuk pengecatan, Kunci-kunci, Lap kering, Kuas', '0', '2022-09-01 08:00:00', '2022-06-29 16:10:40', 0, 8, '2022-09-01', 1),
(127, '2022-01-09', 'P.507020201000/T', 5, 16, 27, 35, 1, 29, 'RANTAI JANGKAR', 'Pembersihan dan pengecatan rantai jangkar dari karat', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Langkah - langkah pemeliharaan :<br></div><ol><li>Rantai diturunkan dan ditata supaya mudah dalam melakukan reparasi </li><li>Setelah rantai ditata maka selanjutnya yaitu memisahkan cat lama dengan cara memukul-mukul rantai dengan palu sehingga cat lamanya lepas</li><li>Kemudian rantai dibersihkan dari debu dan karat menggunakan sapu lidi</li><li>Tahap akhirnya adalah pengecetan rantai menggunakan cat anti korosif </li></ol>', 'Kompressor udara untuk pengecatan, Kunci-kunci, Lap kering, Kuas', '0', '2022-09-01 08:00:00', '2022-06-29 16:11:42', 0, 8, '2022-09-01', 1);
